const Header = () => {

    const menuItems = [
        "MY MOVES",
        "MY PROFILE",
        "GET QUOTES",
        "LOGOUT"
    ]

const allLi = menuItems.map((item)=>{
    return (
        <li class="active" onClick={(event)=>{
            event.preventDefault()
            console.log(event.currentTarget)
        }}><a href=""><i class="icon fas fa-shipping-fast"></i> {item} </a></li> 
    )
})

    return (
        <div class="header">
            <ul>
              {allLi}                
            </ul>
        </div>
    )
}

export default Header;
